svg.desc:
[RoutingIntents
	  |
	  <static>+root: RoutingIntent;
	  <static>+studies: RoutingIntent;
	  <static>+studiesShared: RoutingIntent;
	  <static>+publicRegistry: RoutingIntent;
	  <static>+study: RoutingIntent Function(String, bool);
	  <static>+studyEdit: RoutingIntent Function(String, bool);
	  <static>+studyEditInfo: RoutingIntent Function(String, bool);
	  <static>+studyEditEnrollment: RoutingIntent Function(String, bool);
	  <static>+studyEditInterventions: RoutingIntent Function(String, bool);
	  <static>+studyEditIntervention: RoutingIntent Function(String, String, bool);
	  <static>+studyEditMeasurements: RoutingIntent Function(String, bool);
	  <static>+studyEditReports: RoutingIntent Function(String, bool);
	  <static>+studyEditMeasurement: RoutingIntent Function(String, String, bool);
	  <static>+studyTest: RoutingIntent Function(String, {String? appRoute});
	  <static>+studyRecruit: RoutingIntent Function(String);
	  <static>+studyMonitor: RoutingIntent Function(String);
	  <static>+studyAnalyze: RoutingIntent Function(String);
	  <static>+studySettings: RoutingIntent Function(String, bool);
	  <static>+accountSettings: RoutingIntent;
	  <static>+studyNew: RoutingIntent Function(bool);
	  <static>+login: RoutingIntent;
	  <static>+signup: RoutingIntent;
	  <static>+passwordForgot: RoutingIntent;
	  <static>+passwordForgot2: RoutingIntent Function(String);
	  <static>+passwordRecovery: RoutingIntent;
	  <static>+error: RoutingIntent Function(Exception)
	]

	[RoutingIntents]o-[RoutingIntent]
	[RoutingIntents]o-[RoutingIntent Function(String, bool)]
	[RoutingIntents]o-[RoutingIntent Function(String, String, bool)]
	[RoutingIntents]o-[RoutingIntent Function(String, {String? appRoute})]
	[RoutingIntents]o-[RoutingIntent Function(String)]
	[RoutingIntents]o-[RoutingIntent Function(bool)]
	[RoutingIntents]o-[RoutingIntent Function(Exception)]

	[RoutingIntent
	  |
	  +route: GoRoute;
	  +params: Map<String, String>;
	  +queryParams: Map<String, String>;
	  +dispatch: RoutingIntentDispatch?;
	  +extra: Object?;
	  +routeName: String;
	  +arguments: Map<String, String>;
	  +props: List<Object?>
	  |
	  -dynamic _validateRoute();
	  +bool matches()
	]

	[RoutingIntent]o-[GoRoute]
	[RoutingIntent]o-[RoutingIntentDispatch]
	[<abstract>Equatable]<:-[RoutingIntent]

	[RoutingIntentDispatch
	  |
	  +index: int;
	  <static>+values: List<RoutingIntentDispatch>;
	  <static>+go: RoutingIntentDispatch;
	  <static>+push: RoutingIntentDispatch
	]

	[RoutingIntentDispatch]o-[RoutingIntentDispatch]
	[Enum]<:--[RoutingIntentDispatch]

	[<abstract>GoRouteParamEnum
	  |
	  +String toRouteParam();
	  +String toShortString()
	]

	[RouterKeys
	  |
	  <static>+studyKey: ValueKey<String>;
	  <static>+authKey: ValueKey<String>
	]

	[RouterKeys]o-[ValueKey]

	[RouteParams
	  |
	  <static>+studiesFilter: String;
	  <static>+studyId: String;
	  <static>+isTemplate: String;
	  <static>+measurementId: String;
	  <static>+interventionId: String;
	  <static>+testAppRoute: String
	]

	[RouterConf
	  |
	  <static>+router: GoRouter;
	  <static>+routes: List<GoRoute>;
	  <static>+publicRoutes: List<GoRoute>;
	  <static>+privateRoutes: List<GoRoute>
	  |
	  <static>+GoRoute route()
	]

	[RouterConf]o-[GoRouter]

	[<abstract>StudyFormRouteArgs
	  |
	  +studyCreationArgs: StudyCreationArgs
	]

	[<abstract>StudyFormRouteArgs]o-[StudyCreationArgs]

	[<abstract>QuestionFormRouteArgs
	  |
	  +questionId: String
	]

	[<abstract>StudyFormRouteArgs]<:-[<abstract>QuestionFormRouteArgs]

	[ScreenerQuestionFormRouteArgs
	]

	[<abstract>QuestionFormRouteArgs]<:-[ScreenerQuestionFormRouteArgs]

	[ConsentItemFormRouteArgs
	  |
	  +consentId: String
	]

	[<abstract>StudyFormRouteArgs]<:-[ConsentItemFormRouteArgs]

	[MeasurementFormRouteArgs
	  |
	  +measurementId: String
	]

	[<abstract>StudyFormRouteArgs]<:-[MeasurementFormRouteArgs]

	[SurveyQuestionFormRouteArgs
	  |
	  +questionId: String
	]

	[MeasurementFormRouteArgs]<:-[SurveyQuestionFormRouteArgs]
	[<abstract>QuestionFormRouteArgs]<:--[SurveyQuestionFormRouteArgs]

	[InterventionFormRouteArgs
	  |
	  +interventionId: String
	]

	[<abstract>StudyFormRouteArgs]<:-[InterventionFormRouteArgs]

	[InterventionTaskFormRouteArgs
	  |
	  +taskId: String
	]

	[InterventionFormRouteArgs]<:-[InterventionTaskFormRouteArgs]

	[ReportItemFormRouteArgs
	  |
	  +sectionId: String
	]

	[<abstract>StudyFormRouteArgs]<:-[ReportItemFormRouteArgs]
